import http from './base-http-service';

const listEvent = (id) => http.get(`/calendar/${id}`)
  .then(response => response.data);

const createEvent = (column) => http.post('/calendar', column);

const deleteEvent = (id) => http.delete(`/calendar/${id}`);


export default {
  listEvent,
  createEvent,
  deleteEvent
};
